import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import "./css/commun.css";
import NotFound from "./modules/errors";
import SharkFellas from './modules/SharkFellas';
import { Species, SpeciesList } from './modules/species.js';
import dancer from './pics/surprised_shark.png';


function App() {

    return (
        <>
            <Router>
                <Routes>
                    <Route exact path="/sharks/:id" element={<Species />} />
                    <Route exact path="/sharks" element={<SpeciesList />} />
                    <Route exact path="/habitat" element={<SharkFellas imageUrl={dancer} />} />
                    <Route exact path="*" element={<NotFound />} />
                </Routes>
            </Router>
        </>
    );
}

export default App;
